			stage.addChild(intro);
			intro.x = 1280 / 2;
			intro.y = 720 / 2;
			intro.start_game_btn.alpha = 0.7;
			intro.start_game_btn.addEventListener("mouseover", menuMouseOver); //קישור לפונקציה אשר יוצרת את אפקט ההאבר
			intro.start_game_btn.addEventListener("mouseout", menuMouseOut); //קישור לפונקציה אשר יוצרת את אפקט ההאבר
			intro.start_game_btn.addEventListener("click", endIntro); //בעת לחיצה על כפתור שנמצא בתוך הסימול "אינטרו" תופעל הפונקציה הזאת
